-- shop 데이터베이스 구조 내보내기
DROP DATABASE IF EXISTS `shop`;
CREATE DATABASE IF NOT EXISTS `shop` /*!40100 DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci */;
USE `shop`;

-- 테이블 shop.category 구조 내보내기
CREATE TABLE IF NOT EXISTS `category` (
  `category` varchar(50) NOT NULL,
  `create_date` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`category`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- 테이블 데이터 shop.category:~4 rows (대략적) 내보내기

-- 테이블 shop.emp 구조 내보내기
CREATE TABLE IF NOT EXISTS `emp` (
  `emp_id` varchar(50) NOT NULL,
  `grade` int(11) NOT NULL DEFAULT 0,
  `emp_pw` varchar(50) NOT NULL,
  `emp_name` varchar(50) NOT NULL,
  `emp_job` varchar(50) NOT NULL,
  `hire_date` date NOT NULL,
  `update_date` datetime NOT NULL DEFAULT current_timestamp(),
  `create_date` datetime NOT NULL DEFAULT current_timestamp(),
  `active` enum('ON','OFF') NOT NULL DEFAULT 'OFF',
  PRIMARY KEY (`emp_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- 테이블 데이터 shop.emp:~104 rows (대략적) 내보내기

-- 테이블 shop.product 구조 내보내기
CREATE TABLE IF NOT EXISTS `product` (
  `product_no` int(11) NOT NULL AUTO_INCREMENT,
  `category` varchar(50) NOT NULL,
  `emp_id` varchar(50) NOT NULL,
  `product_title` text NOT NULL,
  `product_content` text NOT NULL,
  `product_price` int(11) NOT NULL,
  `product_amount` int(11) NOT NULL,
  `update_date` datetime NOT NULL DEFAULT current_timestamp(),
  `create_date` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`product_no`) USING BTREE,
  KEY `FK_product_category` (`category`),
  CONSTRAINT `FK_product_category` FOREIGN KEY (`category`) REFERENCES `category` (`category`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1015 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- 테이블 데이터 shop.product:~500 rows (대략적) 내보내기

